import React, { Component } from 'react';

const FormalListInput = (props) => {
  return <input 
  type="text" 
  value={props.value} 
  onKeyPress={
    (event)=> {
      if(event.target.value && event.key === "Enter"){
        props.onKeyPress()
      } }
    }
  onchange={(event)=> props.onchange(event.target.value)} />

}

export default FormalListInput;
